// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';

import { WishlistProvider } from './context/WishlistContext';
import Wishlist from './components/Wishlist'; // Corrected 'componets' to 'components'
import PropertyPosting from './components/PropertyPosting';
import About from './components/About';
import Contact from './components/Contact';
import Footer from './components/Footer';
import ResetPassword from './components/ResetPassword';
import MoreProperties from './components/MoreProperties'; // Import the MoreProperties component

function App() {
  return (
    <WishlistProvider>
      <Router>
        <Navbar />
        <Routes>
          <Route path="/reset-password" element={<ResetPassword />} />
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/post-property" element={<PropertyPosting />} />
          <Route path="/wishlist" element={<Wishlist />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/more-properties" element={<MoreProperties />} /> {/* New Route for More Properties */}
        </Routes>
        <Footer />
      </Router>
    </WishlistProvider>
  );
}

export default App;
